 ,(138,'Our designers  Please check our designers below   \r\n We are proud to introduce INTUZURI at our London boutique, this label is designed by a talented multinational team of young designers, the collection has a modern yet romantic feel, showcasing soft flowing fabrics and intricate detailing. \r\n The collection boasts a variety of shapes and styles, reflecting the growing trend for dynamic necklines, fit to flare shaping and an assortment of luxury fabrics. Intuzuri gowns are cut to enhance a woman’s body shape and designed for ease of ware for the bride on one of the most important days of her life.  \r\n \r\n \r\n Designed by British designer Natalie Gladman (Who named the label after her three children), Natalie is the fifth generation of her family in the garment industry, Natalie designs exquisite, beautiful, unique and elegant gowns, with an emphasis on excellent style and cut using fabrics such as lace, silk chiffons, taffeta, organza, satin, charmeuse silk and Swarovski crystals. \r\n The Madeline Isaac-James label is renowned for it’s beautifully cut weeding dresses that effortlessly fit and flatter, providing affordable designer collections for the modern bride. \r\n \r\n   \r\nFrom the design of Maggie Sottero, the stunning fashion label Sottero & Midgley was born, this dynamic team boasts three generations of experienced talent working together to direct the design’s activity of the Sottero & Midgley collection. \r\nSottero & Midgley continues to offer both contemporary & traditional brides affordable luxury of the highest quality in fashion forward designs. \r\n \r\n \r\n Ivory & Co. is a long established and well respected company within the bridal industry. Best known for their award winning bridal accessories, the business has flourished to supply brides with designs of their dreams all over the world. \r\n The duo behind Ivory & Co. are Sarah Bussey and Alex Longhi who met and studied at Goldsmiths College, University of London Their signature identity for wedding gowns is understated elegance – luxury designs in exquisite silk fabrics for the sophisticated bride. \r\n \r\n   \r\nFeaturing modern simplicity for the understated, feminine bride the SADONI signature captures a distinctive Nordic and natural look that is both enchanting and refreshing. \r\nThe collection is especially designed for confident, style-conscious women who are looking for something different and original, created in luxurious materials such as natural silks, french laces and hand embroidering. \r\n \r\n \r\n Spanish fashion house Novia D’Art have been creating wedding gowns for over forty years and proudly boast the ability to bring out the very best of you in every one of their gowns. \r\n The collection features a contemporary take on traditional style silhouettes. Gowns come in an array of shapes and fabrics including soft satin, elegant laces, organza, tulle and mikado.   \r\n \r\n   \r\nfara sposa was launched by Novia D\'Art to offer brides something different, but affordable. Each design in this collection has an exquisite fit and beautiful detailing.  \r\n  \r\n Designed by Hayley Paige, the Blush bridal collection is characterized by casual elegance and femininity. Soft tulle, cotton lace, and blush tones create a feel of whimsy and romance within each design. \r\n \r\n “I am drawn to the unambiguous glamour that results from combining cotton lace with botanically inspired fabric manipulations. It produces a European sensibility that I have always found alluring.” - Hayley Paige   \r\n  ','DESIGNERS','','/designers','2012-12-02 13:52:00','2013-10-24 23:01:47',NULL,0)
 ,(139,'Intuzuri  We are proud to introduce INTUZURI at our London boutique, this label is designed by a talented multinational team of young designers, the collection has a modern yet romantic feel, showcasing soft flowing fabrics and intricate detailing. \r\n The collection boasts a variety of shapes and styles, reflecting the growing trend for dynamic necklines, fit to flare shaping and an assortment of luxury fabrics. Intuzuri gowns are cut to enhance a woman’s body shape and designed for ease of ware for the bride on one of the most important days of her life. \r\n Check this designer\'s full collection in their official website .  \r\nShow All\r\nADELLA\r\nADONICE\r\nALTHEA\r\nANJELIQUE\r\nARCILLA\r\nATLANTA\r\nAURELIA\r\nAVA\r\nBALERA\r\nBELLA\r\nBERKHAYA\r\nBETHESDA\r\nBEVELYN\r\nBIBA\r\nBREANNA\r\nBRITA\r\nBURDETTE\r\nBURGUNDY\r\n ','INTUZURI','','/designers/intuzuri-costura','2012-12-02 13:53:00','2013-10-24 22:03:18',NULL,0)
 ,(140,'Jasmine \r\nShow All\r\nF141054\r\nF141055\r\nF141069\r\nF151001\r\nF151006\r\nF151009\r\nF151012\r\nF151015\r\nF151020\r\nF151021\r\nF152006\r\n  From top American design house, Jasmine Bridal offers brides the ultimate in fashion, fit and service, Jasmine offers the highest level of quality and design in their gowns, with a fit that makes every bride look and feel beautiful on their big day. \r\n The team of designers spans the world in their experience and brings their skills exclusively to you through Jasmine. \r\n Check this designer\'s full collection in their official website .  ','JASMINE','','/designers/jasmine','2012-12-02 13:53:00','2013-10-14 01:19:13',NULL,0)
