 ,(134,'About us  Golden Sash Bridal was formed by Ilona Shuber in 2012 after the success of her first business and mother company “Golden Stitches Designer Alterations & Tailoring”. Ilona’s passion for luxury fabrics, attention to detail in both cut and finish led her into the world of fashion. \r\n \r\n Ilona started studying fashion design in Poland since the age of 17, after completing her training she worked in the garment production field for leading high street labels such as H&M, Hugo Boss, and a few others. Ilona moved to London in 2005 and worked in designers alterations undertaking specialist alteration and tailoring for exclusive international fashion houses. After her years of experience in the fashion industry, Ilona has taken her career the extra mile and formed Golden sash Bridal. \r\n Golden Sash Bridal is a family run business, which offers brides an exclusive experience and service for their big day. \r\n We believe that your wedding is probably going to be one of the most important events of your life, and we know that it could be daunting when it comes to finding the perfect gown, hence we have carefully selected a stunning collection of gowns from acclaimed designers. \r\n The designers we carry at Golden Sash Bridal are dedicated to creating the finest designs with a careful attention to detail, fit & finish. \r\n We are open by appointment only. Please call 020 7736 2233 to book. \r\n  ','ABOUT US','','/about-us','2012-11-18 23:44:00','2013-10-24 18:58:00',NULL,0)
