 ,(142,'Ivory & Co  Ivory & Co. is a long established and well respected company within the bridal industry. Best known for their award winning bridal accessories, the business has flourished to supply brides with designs of their dreams all over the world. \r\n The duo behind Ivory & Co. are Sarah Bussey and Alex Longhi who met and studied at Goldsmiths College, University of London \r\n Their signature identity for wedding gowns is understated elegance – luxury designs in exquisite silk fabrics for the sophisticated bride. head designer Sarah is passionate about bridalwear design – “a wedding dress should simply be the most important, most flattering and most emotive garment that a woman ever wears in her life. It should be beautifully shaped to give a flattering silhouette and be created from the finest possible silk fabrics with unique and breathtaking styling” \r\n Check this designer\'s full collection in their official website .  \r\nShow All\r\nAllegra\r\nAnais\r\nConstantina\r\nDarcy\r\nElderflower\r\nEvie\r\nIsis\r\nKatarina\r\nParisienne\r\nPeyton\r\nStella\r\nVeronique\r\n ','IVORY & CO','','/designers/ivory-and-co','2012-12-02 18:27:00','2013-10-18 20:44:34',NULL,0)
