 ,(16,10,'/index.php/dashboard/system/backup_restore/update/',NULL,'2013-01-09 21:15:18',0,1,'A new version of concrete5 is now available.','','\n	\n<h2>5.6.0.2</h2>\n\n<h2>Behavioral Improvements</h2>\n\n<ul>\n<li>Improvements to ccm.app.css and ccm.app.js for coexistence with full bootstrap themes. Broke bootstrap.js into a separate JavaScript file.</li>\n</ul>\n\n<h2>Bug Fixes</h2>\n\n<ul>\n<li>Fixed bugs where certain block dialogs and add stack dialog were blank in IE8.</li>\n<li>Fixed IE bugs where the sub-toolbar status bar wouldn’t display</li>\n<li>fixed inability to use page picker when register globals was on.</li>\n<li>Fixed bug where deleting alias would delete source page (again).</li>\n<li>fixing bug where blocks would disappear when adding a layout if the cache was on.</li>\n<li>fix bug in simple permissions display when working with deleted groups.</li>\n<li>Fixed blank file manager window in IE8.</li>\n<li>Attempting to solve intermittent error in PagePermissionAssignments messages that happen on certain upgrades.</li>\n<li>Fixed error when using group combinations on basic workflow.</li>\n<li>Better permissions upgrading when using simple permissions.</li>\n<li>Guestbook comments will now no longer be removed on update of guestbook block.</li>\n<li>Attempting to solve “Illegal Mix \nof Collations” MySQL error that can affect some setups when previewing pages.</li>\n<li>Fixed: http\n://www.concrete5.org/index.php?cID=380195</li>\n<li>File manager saved search cosmetic improvements.</li>\n<li>Removed old code from user avatar uploader that could cause problems if used maliciously.</li>\n<li>Fixed bug where Schedule Guest Access would remove all but guest users from view permission.</li>\n<li>http://www.concrete5.org/developers/bugs/5.6.0.1/getpermissionobject-incompatibles-between-5.5.x-and-5.6.x/</li>\n<li>Pretty URLs are now honored in the Next/Previous block.</li>\n<li>Fixed: http://www.concrete5.org/developers/bugs/5.6.0.1/wrong-notice-in-file-p