 ,(23,10,'/index.php/dashboard/system/backup_restore/update/',NULL,'2013-04-11 15:34:24',0,1,'A new version of concrete5 is now available.','','\n	\n	<h2>Performance Improvement Update</h2>\n	\n	<p>\n	Version 5.6.1 introduces a completely revampled caching system, and should dramatically improve performance on your concrete5 sites. It also fixes a number of bugs and is highly recommended for all users of concrete5.\n	</p>\n	<p>\n	As always, backup your data and site before running the upgrade live.\n	</p>			\n\n	<h3>What\'s new in 5.6.1</h3>\n	\n	<ul>\n	<li>Removed much of the cache library and rewrote calls to dramatically improve performance.</li>\n	<li>Completely new page caching library.</li>\n	<li>Many bug fixes and stability improvements.</li>\n	</ul>\n	\n	<h3><a href=\"http://www.concrete5.org/documentation/background/version_history/5-6-1/\" target=\"_blank\">Full 5.6.1 Release Notes</a></h3>\n	<h3><a href=\"http://www.concrete5.org/documentation/background/version_history/5-6-1-1-release-notes/\" target=\"_blank\">Full 5.6.1.1 Release Notes</a></h3>\n	<h3><a href=\"http://www.concrete5.org/documentation/background/version_history/5-6-1-2-release-notes/\" target=\"_blank\">Full 5.6.1.2 Release Notes</a></h3>\n\n\n\n	')
