 ,(73,'<div class=\"halfwidth\">\r\n<h2><a href=\"#\">Madeline isaac James</a></h2>\r\n<p><span>British designed and with a reputation for excellence, Madeline Isaac-James offers highly desirable collections of stunning designer wedding gowns, providing high quality, beautifully cut gowns that effortlessly fit and flatter in all the right places. Madeline Isaac-James\' design philosophy is quite simple - to create wedding dresses that capture the bride\'s spirit and imagination - ensuring that she looks fabulous and feels confident on her wedding day.</span></p>\r\n</div>\r\n<div class=\"halfwidth\">\r\n<h2><a href=\"#\">Ivory &amp; co</a></h2>\r\n<p><span>Tiaras have been worn by women over the centuries as a mark of beauty and a symbol of elegance.  Ivory &amp; Co. are dedicated to continuing this tradition, offering a stunning range of headpieces and jewellery to brides all over the world.</span></p>\r\n<p><span><span>over the last decade. Every Ivory &amp; Co. accessory is meticulously designed and every opportunity is taken to recognise bridal gown trends and lead the way in current bridal accessory fashion.</span></span></p>\r\n</div>\r\n<div class=\"clear\"> </div>')
 ,(74,'<div class=\"fullwidth\">\r\n<h2><a href=\"#\">Sottero &amp; Midgley</a></h2>\r\n<p><span>British designed and with a reputation for excellence, Madeline Isaac-James offers highly desirable collections of stunning designer wedding gowns, providing high quality, beautifully cut gowns that effortlessly fit and flatter in all the right places. Madeline Isaac-James\' design philosophy is quite simple - to create wedding dresses that capture the bride\'s spirit and imagination - ensuring that she looks fabulous and feels confident on her wedding day.</span></p>\r\n</div>\r\n<div class=\"clear\"> </div>')
 ,(75,'<div class=\"fullwidth\">\r\n<h2><a href=\"#\">Sottero &amp; Midgley</a></h2>\r\n<p>From the design studios of <span class=\"notranslate\">Maggie Sottero</span>, the stunning fashion label \"<span class=\"notranslate\">Sottero &amp; Midgley</span>\" was born. This dynamic team boasts three generations of experienced talent working together to direct the design activities of the<span class=\"notranslate\">Sottero &amp; Midgley</span> collection.</p>\r\n<p>Now entering its seventh season, <span class=\"notranslate\">Sottero and Midgley</span>continues to offer both contemporary and traditional brides affordable luxury of the highest quality in fashion forward designs.</p>\r\n</div>\r\n<div class=\"clear\"> </div>')
