 ,(81,'<div class=\"fullwidth\">\r\n<h2><a href=\"/designers/sottero-and-midgley\">Sottero and Midgley</a></h2>\r\n<p>From the design studios of <span class=\"notranslate\">Maggie Sottero</span>, the stunning fashion label \"<span class=\"notranslate\">Sottero &amp; Midgley</span>\" was born. This dynamic team boasts three generations of experienced talent working together to direct the design activities of the<span class=\"notranslate\">Sottero &amp; Midgley</span> collection.</p>\r\n<p>Now entering its seventh season, <span class=\"notranslate\">Sottero and Midgley</span>continues to offer both contemporary and traditional brides affordable luxury of the highest quality in fashion forward designs.</p>\r\n</div>\r\n<div class=\"clear\"> </div>')
 ,(82,'<p><img class=\"left\" src=\"{CCM:FID_11}\" alt=\"image1.jpg\" /></p>\r\n<p>Set in the heart of London, Golden Sash Bridal offers an exclusive experience with our passionate team of bridal consultants.</p>\r\n<p>We believe that your wedding is probably going to be one of the most important events of your life, and we do know that it could be daunting when it comes to finding the perfect gown, so we have thoughtfully selected and considered a unique collection of gowns from acclaimed designers.</p>\r\n<p>The designers we hold at Golden Sash Bridal are dedicated to producing the finest designs with a carful attention to detail, quality, fit and finish.</p>')
