 ,(90,'<ul>\r\n<li><a title=\"All\" href=\"#portfolio-filter\" data-filter=\"*\">Show All</a></li>\r\n<li><a title=\"Web Design\" href=\"#portfolio-filter\" data-filter=\".web\">Web Design</a></li>\r\n<li><a title=\"Graphic Design\" href=\"#portfolio-filter\" data-filter=\".graphic\">Graphic Design</a></li>\r\n<li><a title=\"Print Design\" href=\"#portfolio-filter\" data-filter=\".print\">Print Design</a></li>\r\n</ul>')
 ,(93,'<p>We are proud to introduce INTUZURI COSTURA at our London boutique,<br />this label is designed by a talented multinational team of young designers,<br />the new collection has a modern yet romantic feel, showcasing soft<br />flowing fabrics and intricate detailing. The collection boasts a variety of<br />shapes and styles, reflecting the growing trend for dynamic necklines, fit<br />to flare shaping and an assortment of luxury fabrics.<br />Intuzuri gowns are cut to enhance a woman’s body shape and designed<br />for ease of ware for the bride on one of the most important days of her<br />life.</p>')
 ,(94,'<p>We are proud to introduce INTUZURI COSTURA at our London boutique, this label is designed by a talented multinational team of young designers, the new collection has a modern yet romantic feel, showcasing soft flowing fabrics and intricate detailing.</p>\r\n<p>The collection boasts a variety of shapes and styles, reflecting the growing trend for dynamic necklines, fit to flare shaping and an assortment of luxury fabrics. Intuzuri gowns are cut to enhance a woman’s body shape and designed for ease of ware for the bride on one of the most important days of her life.</p>')
 ,(95,'<p>From top American design house, Jasmine Bridal offers brides the ultimate in fashion, fit and service, Jasmine offers the highest level of quality and design in their gowns, with a fit that makes every bride look and feel beautiful on their big day, The team designers spans the world in their experience and brings their skills exclusively to yu through Jasmine.</p>')
 ,(96,'<p>From top American design house, Jasmine Bridal offers brides the ultimate in fashion, fit and service, Jasmine offers the highest level of quality and design in their gowns, with a fit that makes every bride look and feel beautiful on their big day.<br /> The team designers spans the world in their experience and brings their skills exclusively to yu through Jasmine.</p>')
 ,(97,'<p>Designed by British designer Natalie Gladman (Who named the label after her three children), Natalie is the fifth generation of her family in the garment industry, Natalie designs exquisite, beautiful, unique and elegant gowns, with an emphasis on excellent style and cut using fabrics such as lace, silk chiffons, taffeta, organza, satin, charmeuse silk and Swarovski crystals.</p>\r\n<p>The Madeline Isaac-James label is renowned for it’s beautifully cut weeding dresses that effortlessly fit and flatter, providing affordable designer collections for the modern bride.</p>')
 ,(98,'<p>From the design of Maggie Sottero, the stunning fashion label Sottero &amp; Midgley was born, this dynamic team boasts three generations of experienced talent working together to direct the design’s activity of the Sottero &amp; Midgley collection.</p>\r\n<p>Now entering it’s sixth season, Sottero &amp; Midgley continues to offer both contemporary &amp; traditional brides affordable luxury of the highest quality in fashion forward designs.</p>')
