 ,(193,'<div class=\"halfwidth\"><a href=\"/designers/intuzuri-costura/\"><img src=\"{CCM:FID_91}\" alt=\"intuzuri_logo.png\" width=\"250\" height=\"58\" /></a>\r\n<p>We are proud to introduce INTUZURI COSTURA at our London boutique, this label is designed by a talented multinational team of young designers, the new collection has a modern yet romantic feel, showcasing soft flowing fabrics and intricate detailing.</p>\r\n<p>The collection boasts a variety of shapes and styles, reflecting the growing trend for dynamic necklines, fit to flare shaping and an assortment of luxury fabrics. Intuzuri gowns are cut to enhance a woman’s body shape and designed for ease of ware for the bride on one of the most important days of her life.</p>\r\n</div>\r\n<div class=\"halfwidth\"><a href=\"/designers/jasmine\"><img src=\"{CCM:FID_93}\" alt=\"Jasmine_Logo.jpg\" width=\"209\" height=\"30\" /></a><br />\r\n<p><span>From top American design house, Jasmine Bridal offers brides the ultimate in fashion, fit and service, Jasmine offers the highest level of quality and design in their gowns, with a fit that makes every bride look and feel beautiful on their big day.</span></p>\r\n<p><br /><span>The team designers spans the world in their experience and brings their skills exclusively to yu through Jasmine.</span></p>\r\n</div>\r\n<div class=\"clear\"> </div>')
 ,(194,'<div class=\"halfwidth\"><a href=\"/designers/madeline-isaac-james\"><img src=\"{CCM:FID_100}\" alt=\"Madeline_Isaac_James_logo.jpg\" width=\"278\" height=\"34\" /></a><br />\r\n<p>Designed by British designer Natalie Gladman (Who named the label after her three children), Natalie is the fifth generation of her family in the garment industry, Natalie designs exquisite, beautiful, unique and elegant gowns, with an emphasis on excellent style and cut using fabrics such as lace, silk chiffons, taffeta, organza, satin, charmeuse silk and Swarovski crystals.</p>\r\n<p>The Madeline Isaac-James label is renowned for it’s beautifully cut weeding dresses that effortlessly fit and flatter, providing affordable designer collections for the modern bride.</p>\r\n</div>\r\n<div class=\"halfwidth\"><a href=\"/designers/ivory-and-co\"><img src=\"{CCM:FID_99}\" alt=\"ivory_logo.jpg\" width=\"270\" height=\"45\" /></a><br />\r\n<p><span>Tiaras have been worn by women over the centuries as a mark of beauty and a symbol of elegance.  Ivory &amp; Co. are dedicated to continuing this tradition, offering a stunning range of headpieces and jewellery to brides all over the world.</span></p>\r\n<p><span><span>over the last decade. Every Ivory &amp; Co. accessory is meticulously designed and every opportunity is taken to recognise bridal gown trends and lead the way in current bridal accessory fashion.</span></span></p>\r\n</div>\r\n<div class=\"clear\"> </div>')
