 ,(220,'			  <a href=\"#showr\" name=\"showr\" id=\"showr\" >Read more about Golden Sash Bridal</a>\r\n			  <div class=\"hiddentxt\">\r\n\r\n				<h2>Golden Sash Bridal</h2>\r\n				<p>\r\n				ILONA SHUBER, Formed Golden Sash Bridal in 2012, Golden Sash bridal idea was born after the rapid success of her first business & mother company Golden Stitches Designer Alterations, Ilona’s passion for fashion and luxury fabrics, attention to detail in both cut & finish led her into the world of fashion.<br/><br/>\r\n\r\n				Studied and trained in fashion in Poland since the age of 17, and after her long role in the industry, Ilona decided to take her career to the extra mile, and that is when she made a decision to create Golden Sash Bridal.<br/><br/>\r\n\r\n				Golden Sash Bridal is very well established family run business, which offers brides an exclusive experience and service for the big day.<br/>\r\n				At Golden sash Bridal we have thoughtfully selected and considered a unique collection of gowns from acclaimed designers. The designers we hold at Golden Sash Bridal are dedicated to producing the finest designs with a carful attention to detail, quality, fit & finish.<br/><br/>\r\n\r\n				Golden Sash Bridal offers brides an exclusive in house bridal alteration service, our experienced seamstresses and dressmakers have the experience to work on any kind of fabric, and all gowns are finished to a high standard.\r\n					\r\n				</p>\r\n			  </div>\r\n\r\n\r\n')
