 ,(343,'<p>Ivory &amp; Co. is a long established and well respected company within the bridal<br />industry. Best known for our award winning bridal accessories, the business has<br />flourished to supply brides with designs of their dreams all over the world.</p>\r\n<p>The duo behind Ivory &amp; Co. are Sarah Bussey and Alex Longhi who met and studied<br />at Goldsmiths College, University of London</p>\r\n<p>Their signature identity for wedding gowns is understated elegance – luxury designs<br />in exquisite silk fabrics for the sophisticated bride. head designer Sarah is passionate<br />about bridalwear design – “a wedding dress should simply be the most important,<br />most flattering and most emotive garment that a woman ever wears in her life.It<br />should be beautifully shaped to give a flattering silhouette and be created from the<br />finest possible silk fabrics with unique and breathtaking styling”</p>\r\n<p><span>Check this designer\'s full collection in their </span><span style=\"text-decoration: underline;\"><a href=\"http://www.ivoryandcobridal.co.uk\" target=\"_blank\">official website</a></span><span> .</span></p>')
