 ,(346,'<div class=\"halfwidth\"><a href=\"/designers/madeline-isaac-james\"><img src=\"{CCM:FID_102}\" alt=\"Madeline_Isaac_James_logo.jpg\" width=\"260\" height=\"44\" /></a><br />\r\n<p>Designed by British designer Natalie Gladman (Who named the label after her three children), Natalie is the fifth generation of her family in the garment industry, Natalie designs exquisite, beautiful, unique and elegant gowns, with an emphasis on excellent style and cut using fabrics such as lace, silk chiffons, taffeta, organza, satin, charmeuse silk and Swarovski crystals.</p>\r\n<p>The Madeline Isaac-James label is renowned for it’s beautifully cut weeding dresses that effortlessly fit and flatter, providing affordable designer collections for the modern bride.</p>\r\n</div>\r\n<div class=\"halfwidth\"><a href=\"/designers/ivory-and-co\"><img src=\"{CCM:FID_99}\" alt=\"ivory_logo.jpg\" width=\"270\" height=\"45\" /></a><br />\r\n<p>Ivory &amp; Co. is a long established and well respected company within the bridal industry. Best known for their award winning bridal accessories, the business has flourished to supply brides with designs of their dreams all over the world.</p>\r\n<p>The duo behind Ivory &amp; Co. are Sarah Bussey and Alex Longhi who met and studied at Goldsmiths College, University of London Their signature identity for wedding gowns is understated elegance – luxury designs in exquisite silk fabrics for the sophisticated bride.</p>\r\n</div>\r\n<div class=\"clear\"> </div>')
