 ,(354,'<div class=\"halfwidth\"><a href=\"/designers/intuzuri-costura/\"><img src=\"files/6513/8170/6911/intuzuri_logo.png\" alt=\"intuzuri_logo.png\" width=\"250\" /></a>\r\n<p>We are proud to introduce INTUZURI COSTURA at our London boutique, this label is designed by a talented multinational team of young designers, the new collection has a modern yet romantic feel, showcasing soft flowing fabrics and intricate detailing.</p>\r\n<p>The collection boasts a variety of shapes and styles, reflecting the growing trend for dynamic necklines, fit to flare shaping and an assortment of luxury fabrics. Intuzuri gowns are cut to enhance a woman’s body shape and designed for ease of ware for the bride on one of the most important days of her life.</p>\r\n</div>\r\n<div class=\"halfwidth\"><a href=\"/designers/jasmine\"><img src=\"{CCM:FID_93}\" alt=\"Jasmine_Logo.jpg\" width=\"209\" height=\"30\" /></a><br />\r\n<p><span>From top American design house, Jasmine Bridal offers brides the ultimate in fashion, fit and service, Jasmine offers the highest level of quality and design in their gowns, with a fit that makes every bride look and feel beautiful on their big day.</span></p>\r\n<p><span>The team of designers spans the world in their experience and brings their skills exclusively to you through Jasmine.</span></p>\r\n</div>\r\n<div class=\"clear\"> </div>')
