 ,(556,'<p>Golden Sash Bridal was formed by Ilona Shuber in 2012 after the success of her first business and mother company “Golden Stitches Designer Alterations &amp; Tailoring”. Ilona’s passion for luxury fabrics, attention to detail in both cut and finish led her into the world of fashion.</p>\r\n<div>\r\n<p>Ilona started studying fashion design in Poland since the age of 17, after completing her training she worked in the garment production field for leading high street labels such as H&amp;M, Hugo Boss, and a few others. Ilona moved to London in 2005 and worked in designers alterations undertaking specialist alteration and tailoring for exclusive international fashion houses. After her years of experience in the fashion industry, Ilona has taken her career the extra mile and formed Golden sash Bridal.</p>\r\n<p>Golden Sash Bridal is a family run business, which offers brides an exclusive experience and service for their big day.</p>\r\n<p>We believe that your wedding is probably going to be one of the most important events of your life, and we know that it could be daunting when it comes to finding the perfect gown, hence we have carefully selected a stunning collection of gowns from acclaimed designers.</p>\r\n<p>The designers we carry at Golden Sash Bridal are dedicated to creating the finest designs with a careful attention to detail, fit &amp; finish.</p>\r\n<p>We are open by appointment only.<br />Please call 020 7736 2233 to book.</p>\r\n</div>')
