 ,(559,'<div class=\"fullwidth\"><a href=\"/designers/blush\"><img style=\"float: left;\" src=\"/files/8813/8265/1718/logo.jpg\" alt=\"Blush logo\" /></a>\r\n<p>Designed by Hayley Paige, the Blush bridal collection is characterized by casual elegance and femininity. Soft tulle, cotton lace, and blush tones create a feel of whimsy and romance within each design.</p>\r\n<br />\r\n<p>“I am drawn to the unambiguous glamour that results from combining cotton lace with botanically inspired fabric manipulations. It produces a European sensibility that I have always found alluring.” - Hayley Paige  </p>\r\n</div>')
